base64 string too long and image loads slowly (React, Node, MongoDB)<p>Before the user signs up, they must upload a profile picture. The picture is in base64 format and the string is way too long. This image is not stored in MongoDB, just as a string in the user profile. Then I use the <code>&lt;img&gt;</code> tag to display it. It loads slowly. Is it because the string is too long?</p>

<p>Also, there is no code on the backend. I just handle the image upload on the client side, this base64 string gets stored in the object of the User, then I can display it with that really long string in the <code>&lt;img&gt;</code> tag. </p>

<p>The good practice would be if I handle the image upload on the server and store the image itself in the database? Do I have to use Multer for this?</p>

<p><a href="https://i.stack.imgur.com/6nJFm.png" rel="nofollow noreferrer">See here</a></p>

<p>Part of signup:</p>

<pre><code>user = new User({
            name,
            email,
            password,
            date,
            age,
            bio,
            gender,
            location,
            file: req.path.file,
            previewUrl,
            image: req.path.file,
        });
</code></pre>

<p>Part of User Schema:</p>

<pre><code>image: {
        type: String,
    },
    file: {
        type: String,
    },
    previewUrl: {
        type: String,
    },
</code></pre>

<p>Client (React):</p>

<pre><code>&lt;input
    id="image"
    type="file"
    accept=".jpg, .png, .jpeg"
    onChange={this.pickedHandler}
    value={''}
    name="image"
/&gt;

componentDidUpdate() {
        if (!this.state.file) {
            return;
        }
        const fileReader = new FileReader();
        fileReader.onload = () =&gt; {
            this.setState({ previewUrl: fileReader.result });
        };
        fileReader.readAsDataURL(this.state.file);
    }

    pickedHandler = (event) =&gt; {
        if (event.target.files &amp;&amp; event.target.files.length === 1) {
            const pickedFile = event.target.files[0];
            this.setState({ file: pickedFile });
        }
    };
</code></pre>

