Multiple group in aggregate<p>In my db there are two types of sessions - "studio", "classroom". I want the count of number of studio sessions and number of classroom sessions AND count of subjects in a classroom session and count of subjects in studio session.</p>

<p>Eg data:</p>

<pre><code>    [
  {
    "key": 1,
    "type": "studio",
    "sub": "english"
  },
  {
    "key": 2,
    "type": "studio",
    "sub": "history"
  },
  {
    "key": 3,
    "type": "classroom",
    "sub": "english"
  },
  {
    "key": 4,
    "type": "studio",
    "sub": "english"
  },
  {
    "key": 5,
    "type": "classroom",
    "sub": "english"
  },
  {
    "key": 5,
    "type": "classroom",
    "sub": "geography"
  }
]
</code></pre>

<p>This is the query I have to group by session type.</p>

<pre><code>    db.collection.aggregate([
  {
    $group: {
      _id: "$type",
      groupedData: {
        $push: {
          key: "$key",
          "sub": "$sub",
          "type": "$type"
        }
      }
    }
  }
])
</code></pre>

<p>By this I get </p>

<pre><code>    [
  {
    "_id": "classroom",
    "groupedData": [
      {
        "key": 3,
        "sub": "english",
        "type": "classroom"
      },
      {
        "key": 5,
        "sub": "english",
        "type": "classroom"
      },
      {
        "key": 5,
        "sub": "geography",
        "type": "classroom"
      }
    ]
  },
  {
    "_id": "studio",
    "groupedData": [
      {
        "key": 1,
        "sub": "english",
        "type": "studio"
      },
      {
        "key": 2,
        "sub": "history",
        "type": "studio"
      },
      {
        "key": 4,
        "sub": "english",
        "type": "studio"
      }
    ]
  }
]
</code></pre>

<p>But I want the count of a subject in studio and class room and total count of sessions in studio and classroom </p>

<p>Eg. </p>

<pre><code>{
  studio: { count: 3, englishInStudio: 2, historyInStudio: 1 },
  classroom: {count: 3, englishInClassroom: 2, geographyInClassroom: 1}
}
</code></pre>

