How to access data from a dynamic Table<p>Presently learning to code and I have done some work here...</p>

<p>Using MongoDB I hardcoded some data (transactions) retrieved them into a table in the front-end.</p>

<p>In other to do this, I created a js file called TransactionItems and listed the properties of interest like this.</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>import React   from 'react';
import {Badge} from "reactstrap";




  const TransactionItem = props =&gt;{

  
    return (

     

    &lt;&gt;
       
      &lt;td&gt;{props.transaction.date}&lt;/td&gt;
      &lt;td&gt; {props.transaction.amount}&lt;/td&gt;
      &lt;td&gt;{props.transaction.token}&lt;/td&gt;
      &lt;td&gt;{props.transaction._id}&lt;/td&gt;
  
      &lt;td className="text-right"&gt;&lt;Badge color="warning"  &gt;
        View
      &lt;/Badge&gt;
      &lt;/td&gt; 
    &lt;/&gt;
    )
}

export default TransactionItem;</code></pre>
</div>
</div>
</p>

<p>I also created a Service connecting to my backend</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>getTransactions : ()=&gt;{
        return fetch('/user/transactions')
                .then(response=&gt;{
                    if(response.status !== 401){
                        return response.json().then(data =&gt; data);
                    }
                    else
                        return {message : {msgBody : "UnAuthorized",msgError : true}};
                });
    },</code></pre>
</div>
</div>
</p>

<p>Then on my Dashboard, I populated a table with data like this</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>import React, {useEffect, useState} from 'react';

import TransactionItem from '../views/TransactionItems';
import TransactionService from '../Services/TransactionService';
import { Col, Row, Card, CardTitle, CardText, CardBody, CardFooter, CardHeader, Button, Table } from 'reactstrap';




const Dashboard = props=&gt;{
  const [user,setUser] = useState([]);
  const [transactions,setTransactions] = useState([]);


  
 

  useEffect(()=&gt;{
        TransactionService.getTransactions().then(data =&gt;{
            setTransactions(data.transactions);
        
        });
      },[]);








    
  return (
 
    &lt;&gt;
      
                &lt;Table responsive&gt;
                  &lt;thead className=" text-warning"&gt;
                    &lt;tr&gt;
                      &lt;th&gt;
                        Date
                      &lt;/th&gt;
                      &lt;th&gt;
                        Amount
                      &lt;/th&gt;
                      &lt;th&gt;
                        Token
                      &lt;/th&gt;
                      &lt;th&gt;
                        Receipt No
                      &lt;/th&gt;
                      &lt;th className="text-right"&gt;
                        Action
                      &lt;/th&gt;
                    &lt;/tr&gt;
                  &lt;/thead&gt;
                  &lt;tbody&gt;
                     {
                                transactions.map(transaction  =&gt;{
                                    return  (&lt;tr&gt;&lt;TransactionItem key={transaction._id} transaction={transaction} loading={loading}/&gt;

                                             &lt;/tr&gt;)
                                })
                            }
                  &lt;/tbody&gt;
                &lt;/Table&gt;
        

      &lt;/&gt;
  );
}

export default Dashboard;</code></pre>
</div>
</div>
</p>

<p>When populated it looks like this
<a href="https://i.stack.imgur.com/HyA9p.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/HyA9p.png" alt="enter image description here"></a> </p>

<p>I have created a receipt sample for each transaction </p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>import React, {useEffect, useState}from 'react';
import {Row, Container} from "reactstrap";
import AuthService from '../Services/AuthService';
import TransactionService from '../Services/TransactionService';

 


function Receipt(props) {

  const [user,setUser] = useState([]);
  const [transaction,setTransaction] = useState();
  
  const id = ''; 

  useEffect(()=&gt;{
    AuthService.isAuthenticated().then(data =&gt;{
     setUser(data.user);
     });
   },[]);


useEffect(()=&gt;{
     TransactionService.getTransaction(id).then(data =&gt;{
      console.log(data);
         setTransaction(data.transaction);
     });
   },[id]);



    return (
        &lt;div&gt;
            &lt;&gt;
      
                
                   &lt;div style={{color: 'RGB(128, 128, 128)', fontSize: '1rem', 
                        fontWeight: '600', 
                        textAlign: 'left',
                        justifyContent: 'center',  
                        alignContent: 'center'}}&gt;Token Credit:&lt;/div&gt;
             
            &lt;/&gt;  
   
        &lt;/div&gt;
    );
}

export default Receipt;</code></pre>
</div>
</div>
</p>

<p>and created the route on the back end to access each transaction object using the transaction _id. I tried to execute it by also creating a service for this in the front end  </p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>getTransaction : (id)=&gt;{
        return fetch('/user/'+id)
      
                .then(response=&gt;{
                    console.log(response.data);
                    if(response.status !== 401){
                        return response.json().then(data =&gt; data);
                    }
                    else
                        return {message : {msgBody : "UnAuthorized",msgError : true}};
                });
    },

}</code></pre>
</div>
</div>

and when tested with a known transaction_id it worked(I console logged the response). But I am not sure how to pass the _id for each transaction on the table such that when the view button is clicked it opens the receipt page and set the state id on the receipt page to the transaction_id of the transaction object, using UseEffect.</p>

<p>Any pointer will be most helpful. Thanks </p>

