How to reuse mongo client using globals, best practices<p>So, I have read other topics here in StackOverflow that try to touch on this but don't have a clear solution to the problem.</p>

<p>First I created a config file for the mongo client which is exported from it.</p>

<pre><code>const { MongoClient } = require('mongodb');

const authMechanism = 'SCRAM-SHA-1';
const user = encodeURIComponent(process.env.MONGODB_USER);
const password = encodeURIComponent(process.env.MONGODB_PASSWORD);
const uri = `mongodb://${user}:${password}@${process.env.MONGODB_URI}?authMechanism=${authMechanism}`;

const client = new MongoClient(uri, {
  useUnifiedTopology: true,
  useNewUrlParser: true,
  loggerLevel: 'info',
});

module.exports = client;
</code></pre>

<p>From there I understand that you must have mongo client initialised once, and only once, before you listen to your application, hence I have created this index.js (entry point to the app) file that does that requiring the typical app.js where all the node config is.</p>

<pre><code>const app = require('./app');
const db = require('../configs/db/db-config');

const port = process.env.PORT;

db.connect((err, client) =&gt; {
  if (err) {
    throw err;
  }
  const database = client.db('dbnamegoeshere');
  app.listen(port, () =&gt; console.log(`Listening on port ${port}...`));
});
</code></pre>

<p>Now, in order for me to reuse that db anywhere I want to make queries or whatever, what is the best practice? How could I add it globally? would adding it globally affect the performance or be a bad practice?</p>

<p>I have seen other examples where people perform these two tasks using a class but yet again all in the same file, not with an export or a global.</p>

<p>One final question, where, and why should I close the db client connection.</p>

<p>Thank you.</p>

