MongoDB Stitch GraphQL Custom Mutation Resolver returning null<p>GraphQL is a newer feature for MongoDB Stitch, and I know it is in beta, so thank you for your help in advance. I am excited about using GraphQL directly in Stitch so I am hoping that maybe I just overlooked something.</p>

<p>The <a href="https://docs.mongodb.com/stitch/graphql/custom-resolvers/" rel="nofollow noreferrer">documentation</a> for the return Payload displays the use of bsonType, but when actually entering the JSON Schema for the payload type it asks for you to use "type" instead of "bsonType". It still works using "bsonType" to me which is odd as long as at least one of the properties uses "type".</p>

<p>Below is the function:</p>

<pre><code>      const mongodb = context.services.get("mongodb-atlas");
      const collection = mongodb.db("&lt;database&gt;").collection("&lt;collection&gt;");
      const query = { _id: BSON.ObjectId(input.id) }
      const update = {
        "$push": {
          "notes": {
            "createdBy": context.user.id, 
            "createdAt": new Date, 
            "text": input.text
          }
        }
      };

      const options = { returnNewDocument: true }

      collection.findOneAndUpdate(query, update, options).then(updatedDocument =&gt; {
        if(updatedDocument) {
      console.log(`Successfully updated document: ${updatedDocument}.`)
    } else {
      console.log("No document matches the provided query.")
    }
    return {
      _id: updatedDocument._id,
      notes: updatedDocument.notes
    }
  })
  .catch(err =&gt; console.error(`Failed to find and update document: ${err}`))
}
</code></pre>

<p>Here is the Input Type in the customer resolver:</p>

<pre><code>  "type": "object",
  "title": "AddNoteToLeadInput",
  "required": [
    "id",
    "text"
  ],
  "properties": {
    "id": {
      "type": "string"
    },
    "text": {
      "type": "string"
    }
  }
}
</code></pre>

