            "type": "string"
          }
        }
      }
    }
  }
}
</code></pre>

<p>When entering the wrong "type" the error states:</p>

<blockquote>
  <p>Expected valid values are:[array boolean integer number null object string]</p>
</blockquote>

<p>When entering the wrong "bsonType" the error states:</p>

<blockquote>
  <p>Expected valid values are:[string object array objectId boolean bool null regex date timestamp int long decimal double number binData]</p>
</blockquote>

<p>I've tried every combination I can think of including changing all "bsonType" to "type". I also tried changing the _id to a string when using "type" or objectId when "bsonType". No matter what combination I try when I use the mutation it does what it is supposed to and adds the note into the lead, but the return payload always displays null. I need it to return the _id and note so that it will update the InMemoryCache in Apollo on the front end.</p>

