Insert embeded document without reading whole document - spring, mongo<p>I have this <code>factory</code> collection :</p>
<pre class="lang-java prettyprint-override"><code>@Document(collection = &quot;factory&quot;)
public class Factory
{
    Private List&lt;Product&gt; products;

}
</code></pre>
<p>which embeds the <code>Product</code> as products.
When I have to add a product to an existing factory :</p>
<pre class="lang-java prettyprint-override"><code>@Autowired
private FactoryRepository factoryRepository;

public void addProduct(Long id, Product product) {
    Factory f = factoryRepository.findById(id);
    f.addProduct(product);
    factoryRepository.save(f);

}
</code></pre>
<p>However, the issue is that product is a <strong>large object which contains a set of heavy attributes</strong> and the <strong>factory can have 2000 products</strong>.</p>
<p>So, the retrieved factory causes large memory consumption although it is not required in this phase. Is there a way to append a new product object directly into the factory document without reading the whole object?</p>
<hr />
<p><strong>EDIT:</strong></p>
<p>As for the comments, I tried :</p>
<pre class="lang-java prettyprint-override"><code>public void addProduct(Long id, Product product) {
        Document find = new Document(&quot;_id&quot;,id);
        Document listItem = new Document(&quot;products&quot;,product);
        Document push = new Document(&quot;$push&quot;, listItem);
        collection.updateOne(find,push);
}       
</code></pre>
<p>This gives error :</p>
<pre><code>org.bson.codecs.configuration.CodecConfigurationException: 
Can't find a codec for class product
</code></pre>
<p>So I modified to convert it to a string before push :</p>
<pre class="lang-java prettyprint-override"><code>public void addProduct(Long id, Product product) {
        Document find = new Document(&quot;_id&quot;,id);
        ObjectWriter ow = new ObjectMapper().writer().withDefaultPrettyPrinter();
        Document listItem = new Document(&quot;products&quot;,ow.writeValueAsString(product));
        Document push = new Document(&quot;$push&quot;, listItem);
        collection.updateOne(find,push);
}     
</code></pre>
<p>This pushed object correctly but when reading :</p>
<pre><code>org.springframework.core.convert.ConverterNotFoundException: 
No converter found capable of converting from type [java.lang.String] to type [Product]
</code></pre>
<p>Still, I got <strong>nowhere</strong> here. Any ideas on fixing this issue?</p>

