Display a specific user by _id (MongoDB, Node, React) error: Cast to ObjectId failed for value "undefined" at path "_id" for model "user"<p>I have page where many users are displayed. When I click on a user, it directs to its page. I want that user to be displayed on this page, but I get an error:
 <strong>Cast to ObjectId failed for value "undefined" at path "_id" for model "user"</strong></p>

<p>Some codes below.</p>

<p>server.js:</p>

<pre><code>app.get('/api/getAnotherUser/:id', getAnotherUser);
</code></pre>

<p>getAnotherUser.js:</p>

<pre><code>const User = require('../models/User');

exports.getAnotherUser = async (req, res) =&gt; {
    try {
        const user = await User.findById(req.params.id).select('-password');
        res.json(user);
    } catch (err) {
        console.error(err.message);
        res.status(500).send('Server error');
    }
};
</code></pre>

<p>User schema:</p>

<pre><code>const mongoose = require('mongoose');

const UserSchema = mongoose.Schema({
    name: {
        type: String,
    }
});

module.exports = mongoose.model('user', UserSchema);
</code></pre>

<p>Path to this page:</p>

<pre><code>&lt;PrivateRoute path="/user/" component={User} /&gt;
</code></pre>

<p>This is where I map through all the users, key is _id, and when I click on the button OPEN, it will redirect that specific user's page:</p>

<pre><code>return this.state.users.map((user) =&gt; (
            &lt;div className="card" key={user._id}&gt;
                &lt;div className="image-container"&gt;
                    &lt;img src={user.image} alt="" /&gt;
                &lt;/div&gt;
                &lt;div className="card-details"&gt;
                    &lt;p&gt;{user.name}&lt;/p&gt;
                    &lt;p&gt;{user.age}&lt;/p&gt;
                    &lt;p&gt;{user.gender}&lt;/p&gt;
                    &lt;p&gt;{user.location}&lt;/p&gt;
                &lt;/div&gt;
                &lt;Link to={`/user/${user._id}`}&gt;
                    &lt;Button&gt;Open&lt;/Button&gt;
                &lt;/Link&gt;
            &lt;/div&gt;
        ));
</code></pre>

<p>The page where I want the specific user to be displayed (by _id):</p>

<p><strong>in my browser:</strong> <a href="http://localhost:3000/user/5ed9d49c7e516616600eb693" rel="nofollow noreferrer">http://localhost:3000/user/5ed9d49c7e516616600eb693</a></p>

<p><strong>in Postman I successfully get the user by _id:</strong> <a href="http://localhost:5000/api/getAnotherUser/5ed9d49c7e516616600eb693" rel="nofollow noreferrer">http://localhost:5000/api/getAnotherUser/5ed9d49c7e516616600eb693</a></p>

<p>MongoDB: "_id": "5ed9d49c7e516616600eb693"</p>

<pre><code>export class User extends Component {
    constructor(props) {
        super(props);
        this.state = {
            name: ''
        };
    }

    componentDidMount() {
        const token = localStorage.getItem('token');
        if (token) {
            this.setState({ loading: true });
            axios.get(`/api/getAnotherUser/${this.props._id}`, { headers: { 'X-Auth-Token': token } }).then((res) =&gt;
                this.setState({
                    name: res.data.name,
                })
            );
        }
    }

    render() {
        return (
            &lt;div&gt;
                &lt;h1&gt;user: {this.state.name}&lt;/h1&gt;
            &lt;/div&gt;
        );
    }
}
</code></pre>

<p>And this is where I get the error. That specific user by _id is not displayed. What went wrong here? In Postman, with the get request, I can fetch that user by _id, but in my application I must have forgotten something. Could anyone please point it out where? Thanks!</p>

