MongoDB update subdocument changes its _id<p>I have the next document, and I want to update the addresses with id of 21, change the alias to 'Family'. I run <code>User.update({ _id: 2, 'addresses._id': 21 }, { 'addresses.$': newAddress });</code></p>

<p>Which works fine, with an annoying side effect, is that Mongo generates a new id for the subdocument. Is there any way to update a subdocument without getting a new id?</p>

<pre><code>'user': {
  '_id': 2,
  'addresses': [
    {
      '_id': '20',
      'alias': 'Work',
      'postal_code': 1235
    },
    {
      '_id': '21',
      'alias': 'Home',
      'postal_code': 1235
    }
  ]
}
</code></pre>

<p>I already solved this using</p>

<pre><code>User.update(
  { _id: req.user._id, 'addresses._id': addressId },
  { $set: {
    'addresses.$.alias': newAddress.alias,
    'addresses.$.address': newAddress.address,
    'addresses.$.areaId': newAddress.areaId,
    'addresses.$.cityId': newAddress.cityId,
    'addresses.$.postal_code': newAddress.postal_code
  } }
);
</code></pre>

<p>This doesn't change the id of the subdocument, but I don't like this solution for obvious reasons.</p>

